import React, { useEffect, useState } from 'react';

function App() {
    const [transactions, setTransactions] = useState([]);
    const [budgets, setBudgets] = useState([]);
    const [form, setForm] = useState({ amount: '', category: '', description: '' });

    // Add the new state for report generation
    const [reportForm, setReportForm] = useState({ startDate: '', endDate: '' });
    const [reportData, setReportData] = useState(null);

    useEffect(() => {
        fetchTransactions();
        fetchBudgets();
    }, []);

    const fetchTransactions = async () => {
        const response = await fetch('http://localhost:5001/transactions');
        const data = await response.json();
        setTransactions(data);
    };

    const fetchBudgets = async () => {
        const response = await fetch('http://localhost:5001/budgets');
        const data = await response.json();
        setBudgets(data);
    };

    const addTransaction = async () => {
        const transaction = {
            user_id: '123', // Mock user ID for now
            ...form,
        };

        try {
            const response = await fetch('http://localhost:5001/transactions', {
                method: 'POST',
                headers: { 'Content-Type': 'application/json' },
                body: JSON.stringify(transaction),
            });

            if (response.ok) {
                console.log('Transaction added:', await response.json());
            } else {
                console.error('Error adding transaction:', response.statusText);
            }

            setForm({ amount: '', category: '', description: '' });
            fetchTransactions();
        } catch (error) {
            console.error('Error adding transaction:', error);
        }
    };

    const deleteTransaction = async (id) => {
        try {
            const response = await fetch(`http://localhost:5001/transactions/${id}`, {
                method: 'DELETE',
            });

            if (response.ok) {
                console.log('Transaction deleted successfully');
                // Remove the transaction from the state
                setTransactions(transactions.filter((t) => t._id !== id));
            } else {
                console.error('Error deleting transaction:', response.statusText);
            }
        } catch (error) {
            console.error('Error deleting transaction:', error);
        }
    };

    const fetchReport = async () => {
        try {
            const response = await fetch(`http://localhost:5001/reports?startDate=${reportForm.startDate}&endDate=${reportForm.endDate}`);
            if (!response.ok) {
                throw new Error('Error fetching report');
            }
            const data = await response.json();
            setReportData(data);
        } catch (error) {
            console.error('Error fetching report:', error);
        }
    };



    return (
        <div>
            <header className="logo-header">
                <img 
                    src="/logo.png" 
                    alt="FinWise Logo" 
                    className="logo" 
                />
            </header>
            <h1>Personal Finance Dashboard</h1>
            <section>
                <h2>Add Transaction</h2>
                <input 
                    type="number" 
                    placeholder="Amount" 
                    value={form.amount} 
                    onChange={(e) => setForm({ ...form, amount: e.target.value })}
                />
                <input 
                    type="text" 
                    placeholder="Category" 
                    value={form.category} 
                    onChange={(e) => setForm({ ...form, category: e.target.value })}
                />
                <input 
                    type="text" 
                    placeholder="Description" 
                    value={form.description} 
                    onChange={(e) => setForm({ ...form, description: e.target.value })}
                />
                <input 
                    type="date"
                    placeholder="Date"
                    value={form.date}
                    onChange={(e) => setForm({ ...form, date: e.target.value })}
                />
                <button onClick={addTransaction}>Add Transaction</button>
            </section>
            <section>
                <h2>Transactions</h2>
                <ul>
        {transactions.map((t) => (
            <li key={t._id} style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center' }}>
                <div>
                    <strong>{new Date(t.date).toLocaleDateString('en-US')}</strong> | ${t.amount} - {t.category} ({t.description})
                </div>
                {/* Add Delete Button */}
                <button
                    style={{ marginLeft: '10px', backgroundColor: 'red', color: 'white', border: 'none', cursor: 'pointer' }}
                    onClick={() => deleteTransaction(t._id)}
                >
                    Delete
                </button>
            </li>
        ))}
    </ul>
            </section>
            <section>
                <h2>Budgets</h2>
                <ul>
                    {budgets.map((b) => (
                        <li key={b._id}>
                            {b.category}: ${b.amount} (Ends: {new Date(b.end_date).toLocaleDateString()})
                        </li>
                    ))}
                </ul>
            </section>
        </div>
    );
}

export default App;
